import React from 'react';
import './ServicesPage.css'; // Ensure this path points to your CSS file

const Services = () => {
    const services = [
        {
            icon: "strategic-marketing-icon.png",
            title: "Strategic Marketing",
            description: "Crafting strategies to put your brand ahead in the game.",
        },
        {
            icon: "social-media-management-icon.png",
            title: "Social Media Management",
            description: "Your brand, trending across all platforms with style.",
        },
        {
            icon: "seo-icon.png",
            title: "Search Engine Optimization (SEO)",
            description:
                "Boost your online swagger! We'll spruce up your website so Google has no choice but to be your biggest fan.",
        },
        {
            icon: "creative-design-icon.png",
            title: "Creative Design",
            description: "From logos to ad campaigns, we make ideas come alive.",
        },
        {
            icon: "technical-solutions-icon.png",
            title: "Technical Solutions",
            description: "Tech-savvy fixes to keep your business running smoothly.",
        },
        {
            icon: "automation-services-icon.png",
            title: "Automation Services",
            description: "Streamline operations with cutting-edge automation.",
        },
        {
            icon: "brand-pitching-icon.png",
            title: "Brand Pitching",
            description: "Create compelling pitches that resonate and convert.",
        },
        {
            icon: "sales-leads-icon.png",
            title: "Sales/Leads",
            description: "Proven strategies to drive growth and generate leads.",
        },
        {
            icon: "video-editing-icon.png",
            title: "Video Editing",
            description: "Captivating stories told through stunning visuals.",
        },
        {
            icon: "website-development-icon.png",
            title: "Website Development",
            description: "Modern, responsive websites tailored to your brand.",
        },
        {
            icon: "app-development-icon.png",
            title: "Application Development",
            description: "Mobile apps that captivate and perform.",
        },
        {
            icon: "software-development-icon.png",
            title: "Software Development",
            description: "Custom software solutions for your unique needs.",
        },
        {
            icon: "hosting-solutions-icon.png",
            title: "Hosting Solutions",
            description: "Reliable hosting for your digital presence.",
        },
        {
            icon: "video-campaign-icon.png",
            title: "Video Campaign Delivery",
            description: "End-to-end management of impactful video campaigns.",
        },
    ];

    return (
        <section id="services" className="services-page">
            <div className="services-content">
                <h2>Our Services</h2>
                <div className="service-container">
                    {services.map((service, index) => (
                        <div className="service-item" key={index}>
                            <img
                                src={service.icon}
                                alt={service.title}
                                className="service-icon"
                            />
                            <h3>{service.title}</h3>
                            <p>{service.description}</p>
                        </div>
                    ))}
                </div>
            </div>
        </section>
    );
};

export default Services;
